The game uses the Macroquad library , by Fedor , who is also part of the core team of Fish Fight. This means that our scenes are composed of scene nodes, made by implementing the Node type. The most relevant method, when discussing physics, is the fixed_update method, which is called for every node, every physics frame. This means that, in order to explore the existing physics of any existing in-game object, you should browse to the corresponding node source file, in src/nodes , and look for the impl Node for T section and the encapsulated fixed_update implementation. This method takes a RefMut<T> as an argument (can be both mutable and immutable), where T is the type of the node that it is being implemented for. From here, you can do many things; like manipulating the node, itself, through the RefMut<T> parameter, as well as access other nodes by fetching them from the scene, either by type, or by specific traits, made by calling node.provides([...]) in a nodes ready implementation. For examples of this, you can check the code of most nodes for the code providing the Sproingable trait, for example. Examples of code for accessing other nodes: // This is from the ArmedGrenade node, showing how we iterate over players, checking for
// collision and killing the player if the explosion "collides" with the player
for mut player in scene::find_nodes_by_type::<crate::nodes::Player>() { let intersect = grenade_rect.intersect(Rect::new( player.body.pos.x, player.body.pos.y, PLAYER_HITBOX_WIDTH, PLAYER_HITBOX_HEIGHT, )); if !intersect.is_none() { let direction = node.body.pos.x > (player.body.pos.x + 10.); scene::find_node_by_type::<crate::nodes::Camera>() .unwrap() .shake(); player.kill(direction); }
} // This is from the Sproinger node, iterating through nodes providing the Sproingable trait
// and checking for collision, before performing a "sproing" on them, if they overlap
for (_actor, mut body_lens, size) in scene::find_nodes_with::<Sproingable>() { if body_lens.get().is_some() { let body = body_lens.get().unwrap(); if body.speed.length() > Self::STOPPED_THRESHOLD { let intersect = sproinger_rect .intersect(Rect::new(body.pos.x, body.pos.y, size.x, size.y)); if !intersect.is_none() { let resources = storage::get_mut::<Resources>(); play_sound_once(resources.jump_sound); body.speed.y = -Self::FORCE; node.has_sproinged = true; // self.sprite.set_animation(1); // self.sprite.playing = true; Sproinger::animate(node.handle()); } } }
}

