To add an item or, in this case, a weapon to the game, you will first have to define the item in a data file. These files are located in assets/items and will typically have the same name as the item's id. Since we are creating a sniper rifle, we can give this file the name sniper_rifle.json. This path to the file must also be added to the file assets/items.json, so that game will know where to look for it. This is done by simply adding the path to the file, relative to the items.json file, to the array within. In this case, the path that we add will be items/sniper_rifle.json. Now, it is time to define the weapons parameters inside the items.json file. Begin by creating a new object and adding the id (sniper_rifle) and the item type (weapon). Every item that we add will also need a set of sprite parameters (SpriteParams) that define the sprite that will be drawn when the item is on the ground, before being picked up by the player. Typically, it will be enough to include a texture id here, as things like sprite size will most often be defined in the texture's entry in the assets/textures.json file. We will also need to define a collider size, that will be the size of the collider used when checking if a player is close enough to the item to pick it up: { "id": "sniper_rifle", "type": "weapon", "sprite": { "texture": "musket" }, "collider_size": { "x": 16, "y": 16 }
} That is all the required data for the item part of our definition, so now it is time need to add the parameters required for weapon item variants. We have quite a few options for customization here that can be explored by looking at the WeaponParams struct in the source code. We are required to define at least the ActiveEffectParams, which holds the parameters of the effect that will be instantiated when the weapon is used to attack, and a WeaponAnimationParams, which holds the parameters of the animation players that will be used to animate and draw the weapon when it is equipped. We also wanted our rifle to have two bullets and a heavy recoil, so we should also define these parameters. We should also specify a cooldown for our weapon, which governs the interval between shots, and an attack duration, which controls the length of time that the player is locked in the attack state (input blocked), after an attack. We should also add a sound effect, to be played when the weapon is used. We will also have to add an effect offset, which is the offset from the weapons position to the point where the weapons effect will originate. Now, it is time to define the parameters for the affect that will be instantiated when we fire the gun. There are several variants to choose from, or a new one can be implemented, either as a new variant of ActiveEffectKind or as an implementation of the WeaponEffectCoroutine type. In our case, however, there is already a perfect fit; the Projectile variant. We will want to specify a projectile speed, a projectile range and a specification for how the projectile should be drawn. A projectile can be drawn as a simple colored shape or using a texture. We will use a texture and we will also color the projectile by setting a tint: { "id": "sniper_rifle", "type": "weapon", "sprite": { "texture": "musket" }, "uses": 2, "cooldown": 1.5, "attack_duration": 1.0, "recoil": 1400.0, "sound_effect": "shoot", "collider_size": { "x": 64, "y": 24 }, "effect_offset": { "x": 64, "y": 16 }, "effects": { "type": "projectile", "projectile": { "type": "sprite", "sprite": { "texture": "small_projectile", "size": { "x": 8, "y": 4 }, "tint": { "r": 0.9, "g": 0.75, "b": 0.12, "a": 1.0 } } }, "range": 600.0, "speed": 25.0 }, "animation": { "texture": "musket", "animations": [ { "id": "idle", "row": 0, "frames": 1, "fps": 1 }, { "id": "attack", "row": 1, "frames": 3, "fps": 15 } ] }, "effect_animation": { "texture": "musket", "animations": [ { "id": "attack_effect", "row": 2, "frames": 4, "fps": 12 } ] }
}

